import React from 'react'
import { Query } from 'react-apollo'
import Car from './Car'
// import { Query } from 'react-apollo'
import { GET_CARLIST } from '../queries'

import { GET_OWNER} from '../queries'
import Owner from './Owner'

import { List, Container } from '@material-ui/core'

const Owners = () => (
  <Query query={GET_OWNER}>
    {({ loading, error, data }) => {
      console.log('data', data)
      if (loading) return <p>Loading...</p>
      if (error) return <p>Error: {error.message}</p>
      return (
        <ul>
          {data.owners.map(({ id, firstName, lastName }) => (
            <Container>
              <List>
                <Owner
                  key={id}
                  id={id}
                  firstName={firstName}
                  lastName={lastName}
                />
              </List>
            </Container>
          ))}
        </ul>
        // test 




        // test
      )
    }}
    <div>
   <Query query={GET_CARLIST}>
     {({ loading, error, data }) => {
       console.log('data', data)
       if (loading) return <p>Loading...</p>
       if (error) return <p>Error: {error.message}</p>
       return (
         <ul>
           {data.carlist.map(({ id, year, make, model, price, ownerId }) => {
             if (ownerId === id) {

               return (
                 <Container key={id}>
                   <List>
                     <Car
                       key={id}
                       id={id}
                       year={year}
                       make={make}
                       model={model}
                       price={price}
                       ownerId={ownerId}
                     />
                   </List>
                 </Container>
               )
             }

           }
           )}
         </ul>
       )
     }}
   </Query>
 </div>
  </Query>
)


export default Owners
